import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import ActionVerite from './components/ActionVerite'; // Assurez-vous d'avoir le bon chemin
import Generator from './components/Generator'; // Si vous avez d'autres pages
import Roleplay from './components/Roleplay'; // Si vous avez d'autres pages
import MainComponentContent from './components/MainComponentContent'; // Page d'accueil

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={MainComponentContent} />
        <Route path="/action-verite" component={ActionVerite} />
        <Route path="/generator" component={Generator} />
        <Route path="/roleplay" component={Roleplay} />
      </Switch>
    </Router>
  );
};

export default App;
